import React, { useEffect, useState } from 'react';
import Listagem from '../components/Listagem';

const ListarSimulacoes = ({ onVoltar }) => {
  const [simulacoes, setSimulacoes] = useState([]);
  console.log(simulacoes, 'Simulacoes');

  useEffect(() => {
    const obterSimulacoes = async () => {
      try {
        const response = await fetch('http://localhost:3000/api/listar-simulacoes');
        if (response.ok) {
          const data = await response.json();
          setSimulacoes(data.simulacoes || []); // Certifique-se de pegar a propriedade correta
        } else {
          console.error('Erro ao obter lista de simulações:', response.statusText);
        }
      } catch (error) {
        console.error('Erro ao conectar ao backend:', error);
      }
    };

    obterSimulacoes();
  }, []);

  return (
    <div>
      <Listagem simulacoes={simulacoes} />
    </div>
  );
};

export default ListarSimulacoes;
